import React,{Component} from 'react'
import classes from './Maze.module.css'
import Cell from '../Cell/Cell'


class Maze extends Component
{
    constructor(props)
    {
        super(props)
        let grid=new Array(3)
        for(let i=0;i<3;i++)
          grid[i]=new Array(3)

        console.log(grid)

        this.state={
            grid:grid
        }
    }

    render()
    {
        return (
            <div className={classes.gridContainer}>
                <Cell>1</Cell>
                <Cell>2</Cell>
                <Cell>3</Cell>
                <Cell>4</Cell>
                <Cell>5</Cell>
                <Cell>6</Cell>
                <Cell>7</Cell>
                <Cell>8</Cell>
                <Cell>9</Cell>

            </div>
        )
    }

}

export default Maze
